import React from 'react'
import { Card, CardMedia, CardActions, Typography, Button, CardContent, Grid2} from '@mui/material'


const ListMovies = () => {
  
    const movies = [
        { id: 1, title: "Inception", year: 2010, genre: "Sci-Fi", rating: 8.8, image:"https://cdn.shopify.com/s/files/1/1416/8662/products/inception_2010_imax_original_film_art_2000x.jpg?v=1551890318"},
        { id: 2, title: "The Dark Knight", year: 2008, genre: "Action", rating: 9.0, image:"data:image/jpeg;base64," },
        { id: 3, title: "Interstellar", year: 2014, genre: "Adventure", rating: 8.6, image:"https://i.pinimg.com/originals/11/1c/5c/111c5c9ad99661af2d80e38948cf29d8.jpg" },
        { id: 4, title: "Memento", year: 2000, genre: "Thriller", rating: 8.5, image:"https://th.bing.com/th/id/OIP._bzfPgo5te3uXXsn8h0vpgHaLG?rs=1&pid=ImgDetMain" },
        ];

    return (
    <div style={{marginTop : '1%'}}>
        <Grid2 container spacing={2}>

            {movies.map((val,i) => {

                return(
                    <Grid2 size={{ xs:12, md:4}}>
                    <Card sx={{ maxWidth: 345 }}>
                <CardMedia
                  component="img"
                  alt="green iguana"
                  height="200"
                  image= {val.image}
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="div">
                    {val.title}
                  </Typography>
                
                  <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                    Year : {val.year}
                  </Typography>

                  <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                    Genre : {val.genre}
                  </Typography>

                  <Typography variant="body2" sx={{ color: 'text.secondary' }}>
                    Rating : {val.rating}
                  </Typography>

                   
                </CardContent>
              </Card>

              </Grid2>
            );

            })}

        </Grid2>
    </div>
  )
}

export default ListMovies
